DROP TABLE IF EXISTS `kugan_skills`;
CREATE TABLE IF NOT EXISTS `kugan_skills` (
  `ID` mediumint(9) unsigned NOT NULL AUTO_INCREMENT,
  `kuganID` mediumint(9) unsigned NOT NULL DEFAULT '0',
  `name` text NOT NULL,
  `type` text NOT NULL,
  `wiki` text NOT NULL,
  `specializationID` mediumint(9) unsigned NOT NULL DEFAULT '0',
  `level` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `cost` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `skill` mediumint(9) unsigned NOT NULL DEFAULT '0',
  `descWith` text NOT NULL,
  `descWithout` text NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;





DROP TABLE IF EXISTS `kugan_specializations`;
CREATE TABLE IF NOT EXISTS `kugan_specializations` (
  `ID` mediumint(9) unsigned NOT NULL AUTO_INCREMENT,
  `specializationID` mediumint(9) unsigned NOT NULL DEFAULT '0',
  `groupName` text NOT NULL,
  `nameEN` text NOT NULL,
  `nameFR` text NOT NULL,
  `wiki` text NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;

